import Sidebar from '../../components/sidebar/Sidebar'
import './contact.css'

export default function Contact() {

  return (
      <>
        <Header/>
        <div className='contact'>
            <span className="contactTitle">Please contact Anna for any questions about this blog app.</span>
        </div>
      </>

  )
}
